import{_ as e,c as t,o as a,a4 as i}from"./chunks/framework.CzsDe1xi.js";const r="/assets/corvas_mech.BD3ASTPL.png",l="/assets/velocitus_mech.CS2UGoie.png",o="/assets/Arquebex_mech.BpFi99k-.png",s="/assets/amprex_build.uS_NlySC.png",n="/assets/smeeta_build.C2CHFSKf.png",h="/assets/wyrm_build.DRXsuzJw.png",d="/assets/vulklok_build.DaISW22Z.png",u="/assets/verglas_build.C9uiIPOB.png",x=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"beginner/other-builds.md","filePath":"beginner/other-builds.md"}'),c={name:"beginner/other-builds.md"},g=i('<h2 id="mech-setup" tabindex="-1"><strong>Mech Setup</strong> <a class="header-anchor" href="#mech-setup" aria-label="Permalink to &quot;**Mech Setup**&quot;">​</a></h2><p>Mech build doesn’t matter as you shouldn’t spend much time in it. A basic health Mod should be enough if you have problems.</p><h4 id="corvas-build" tabindex="-1"><strong>Corvas Build</strong> <a class="header-anchor" href="#corvas-build" aria-label="Permalink to &quot;**Corvas Build**&quot;">​</a></h4><div style="width:100%;text-align:left;"><img src="'+r+'" alt="corvas_mech" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/601657/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>For use on Necramech, this build can oneshot limbs if you charge it enough.</li><li>Corvas is a good pick if you plan on getting rivens down the line, as it has a lot of viable riven variety.</li><li>Fire rate is a bit low, so using Heavy Weapon may be faster.</li><li>The build uses Primed Rubedo-Lined Barrel even if you’re using vex armor because Necramech doesn’t get Warframe buffs.</li><li>Is affected by <a href="/miscellaneous/bugs.html#archgun-hitbox-bug"><strong>hitbox bug</strong></a></li></ul><h4 id="velocitus-build" tabindex="-1"><strong>Velocitus Build</strong> <a class="header-anchor" href="#velocitus-build" aria-label="Permalink to &quot;**Velocitus Build**&quot;">​</a></h4><div style="width:100%;text-align:left;"><img src="'+l+'" alt="velocitus_mech" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/367048/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>For use on Necramech, this build will oneshot limbs if the weapon is fully charged.</li><li>Velocitus shots are either fully charged or not charged, so you need to fully charge it.</li><li>Velocitus only has a single pellet, so it will hit where you’re aiming, making it easier to avoid going underneath Profit Taker.</li></ul><h4 id="arquebex-build-used-to-clear-toxin-shield" tabindex="-1"><strong>Arquebex build (Used to clear Toxin Shield)</strong> <a class="header-anchor" href="#arquebex-build-used-to-clear-toxin-shield" aria-label="Permalink to &quot;**Arquebex build (Used to clear Toxin Shield)**&quot;">​</a></h4><div style="width:100%;text-align:left;"><img src="'+o+'" alt="Arquebex_mech" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/318743/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>This is one of the best ways to clear Toxin for frames that can’t do it themselves. Manually cycling Toxin works, but this saves a fair few seconds.</li><li>Any frame with an Exalted Weapon won’t need this. They can put Toxin on the Exalted Weapon.</li><li>Volt and Saryn don’t need this due to Toxic Lash and Volt shield, respectively.</li><li>If the last element in a shield is Toxin, you can go straight from clearing the shield with Arquebex to breaking legs with Corvas.</li><li>Arquebex doesn’t do any damage to Profit-Taker’s legs or body.</li></ul><h2 id="on-call-crew" tabindex="-1"><strong>On-Call Crew</strong> <a class="header-anchor" href="#on-call-crew" aria-label="Permalink to &quot;**On-Call Crew**&quot;">​</a></h2><p>As the crewmate (more on this <a href="/advanced/speedrun-strats.html#on-call-strats"><strong>later</strong></a>) only needs to cover toxin (or electricity with Saryn), basically any weapon works as long as it:</p><ul><li>Has decent critical stats and good damage.</li><li>Has a good enough fire rate.</li><li>Ideally, has some sort of crowd control, i.e. chaining beams or explosions.</li></ul><p>An example of a usable weapon is the Amprex, modded for toxin:</p><div style="width:100%;text-align:left;"><img src="'+s+'" alt="amprex_build" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/599307/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>Crewmates don&#39;t use rivens or conditional arcanes.</li><li>An elite crewmate with the proper cc effect can make point strike flex, as long as you get 100% cc.</li><li>Other usable weapons are found in <a href="/advanced/speedrun-strats.html#on-call-strats"><strong>On Call Strats</strong></a></li></ul><h2 id="companion-builds" tabindex="-1"><strong>Companion Builds</strong> <a class="header-anchor" href="#companion-builds" aria-label="Permalink to &quot;**Companion Builds**&quot;">​</a></h2><h4 id="smeeta-kavat" tabindex="-1"><strong>Smeeta Kavat</strong> <a class="header-anchor" href="#smeeta-kavat" aria-label="Permalink to &quot;**Smeeta Kavat**&quot;">​</a></h4><div style="width:100%;text-align:left;"><img src="'+n+'" alt="smeeta_build" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/601642/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>Essential mods are: Charm, Synth Fiber, Tek Enhance, Bite, Tenacious Bond, and Fetch. All others are flex. Make sure Charm is in the same mod slot as the build shown here due to companions using <a href="https://warframe.fandom.com/wiki/Category:Penjaga_Mods" target="_blank" rel="noreferrer"><strong>Precepts</strong></a>.</li><li>This build should work on all Kavats, with Charm replaced as appropriate.</li></ul><h4 id="wyrm-prime" tabindex="-1"><strong>Wyrm Prime</strong> <a class="header-anchor" href="#wyrm-prime" aria-label="Permalink to &quot;**Wyrm Prime**&quot;">​</a></h4><div style="width:100%;text-align:left;"><img src="'+h+'" alt="wyrm_build" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/396909/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>If not using Verglas, Warrior/Assault Mode is flex.</li><li>Enhanced Vitality is flex.</li><li>Wyrm Prime is the only sentinel with enough base shields to rely on Reinforced Bond.</li><li>Negate allows you to drop other forms of knockdown resistance with a bit of skill.</li></ul><p><strong>Weapons:</strong></p><h4 id="vulklok-build" tabindex="-1"><strong>Vulklok Build</strong> <a class="header-anchor" href="#vulklok-build" aria-label="Permalink to &quot;**Vulklok Build**&quot;">​</a></h4><div style="width:100%;text-align:left;"><img src="'+d+'" alt="vulklok_build" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/601634/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>Full build is far from necessary. You can just use Point Strike to proc Tenacious Bond and be done.</li><li>The Vulklok’s high base critical chance allows it to easily hit the 50% critical chance required for Tenacious Bond.</li><li>For Tenacious Bond, only Critical Delay or Point Strike matter.</li></ul><h4 id="verglas-build" tabindex="-1"><strong>Verglas Build</strong> <a class="header-anchor" href="#verglas-build" aria-label="Permalink to &quot;**Verglas Build**&quot;">​</a></h4><div style="width:100%;text-align:left;"><img src="'+u+'" alt="verglas_build" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/601638/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>The Verglas can do a decent job clearing adds when helped by Total Eclipse, however its damage against shields is paltry.</li></ul>',39),m=[g];function b(f,p,v,_,y,k){return a(),t("div",null,m)}const q=e(c,[["render",b]]);export{x as __pageData,q as default};
